import React, { useEffect, useState } from 'react';
import Side from '../side/side';
import '../styles/voter.modules.css';
import axios from 'axios';
import { useParams } from 'react-router-dom';


const Voter_preview = () => {
    let params = useParams()
    let Useremail = params.Useremail
    const [voter, setvoter] = useState("")
    useEffect(()=>{
        axios.get(`http://localhost:2000/csvusers/${Useremail}`)
        .then(res=>{
            setvoter(res.data)
        })
    },[])

    return(
        <>
        <Side/>
        <div className="voter_preview">
            <h1>hello</h1>
            {Array.isArray(voter.data) && voter.data.length > 0 ? (
                        voter.data.map((title) => (
                            <>
                            <div className="candidate_profile">
                            <img src={`http://localhost:2000/uploads/${title.image}`} alt={title.candidateName} id="candidate_img"/>
                            <div className="right">
                                <p className="label-candidate">{title.candidateName}</p>
                                <p className="label-candidate">{title.position}</p>
                            </div>
                            </div>
                            </>
                        ))
                    ) : (
                        <>
                        <p id="label">No data found</p>
                        <button class="btn" data-toggle="modal" data-target="#devModal">Add candidate</button> 
                        </>
                    )}
        </div> 
        </>
    )
}



export default Voter_preview;
